import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import MyStatistics from './MyStatistics';
import MyPie from './MyPie';
import MyBar from './MyBar';

ReactDOM.render(
  <div>
    <MyStatistics />
    <MyPie />
    <MyBar />
  </div>,
  document.getElementById('root')
);

